import React from "react";
import { NavLink } from "react-router-dom";

const Identification = () => {
  const nextHandler = (e) => {
    e.preventDefault();
  };
  return (
    <>
      <form className="form-shop" onSubmit={nextHandler}>
        <label>صورة البطاقة الامامية</label>
        <input type="checkbox" />
        <label>صورة البطاقة الخلفية</label>
        <input type="file" />
        <input type="submit" value="إبدأ الان" />
      </form>
      <p>
        <bdi> مجرد إنشاء الحساب أنت توافق على </bdi>
        <NavLink to="/conditions">الشروط والأحكام </NavLink>و
        <NavLink to="/privacy">سياسة الخصوصية </NavLink>
      </p>
    </>
  );
};

export default Identification;
